    false,nt"url": null,nt"notes": "The Aircraft Scanners data set contains
    digital imagery acquired from several multispectral scanners including NS-001 Mutispectral
    scanner, Daedalus thematic mapper simulator (TMS), scanners and the thermal infrared
    multispectral scanner (TIMS). Data are collected from selected areas over the conterminous
    United States, Alaska, and Hawaii by NASA ER-2 and NASA C-130B aircraft operating
    from the NASA Ames Research Center (ARC) in Moffett Field, California, and by NASA
    Learjet aircraft operating from Stennis Space Center in Bay St. Louis, Mississippi.
    Limited international acquisitions also are available.",nt"license_title":
